              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Fashion"} heading={"Trending Fashion"} />
          <div className="grid grid-cols-6 gap-10">
            <div className="relative w-44 h-44 bg-orange-300 flex justify-center rounded-full">
              <img className="absolute object-contain h-60 bottom-0" src={fa2} alt="" />
            </div>
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"This month"} heading={"New Arrival"} />
        </div>
        <div className="product-catalog">
          <Heading title={"Accessories"} heading={"Electronics Accessories"} />
          <div className="grid grid-cols-3 gap-10">
            <AccessoryCard />
            <AccessoryCard />
            <AccessoryCard />
          </div>
        </div>
      </div>
    </section>
  );
};

export default Homepage;
